  [],\n\t\"revision_timestamp\": \"2016-07-27T22:42:56.839050\",\n\t\"name\": \"arapaho-national-wildlife-refuge-narrative-report-calendar-year-1969\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Arapaho
  National Wildlife Refuge outlines Refuge accomplishments during the 1969 calendar
  year.  The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover conditions during the year. Wildlife- including
  migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
  mammals, and raptors- is also covered. The Refuge development and maintenance section
  discusses physical developments, plantings, and vegetation control. Resource management
  is outlined; topics include grazing. A progress report on field investigations and
  applied research is also provided. The public relations section of the report describes
  recreational uses, Refuge visitors, Refuge participation, and safety. Items of interest,
  N-R forms, and photographs are attached.\",\n\t\"license_title\": \"License Not
